import React from "react";
import {Card} from "antd";
import "./ItemCard.scss"

const ItemCard = ({item, resource}) => {

    console.log(    45,item)
    console.log(item)
    const {name, url, id} = item

    const Img = () => {
        return (`https://starwars-visualguide.com/assets/img/${resource}/${id}.jpg`)
    }

    return  <div className="rootCard">
        <Card
            hoverable
            className="card"
            title={name}
        >
            <img src={Img}/>
        </Card>
    </div>
};
export default ItemCard;
